import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { customersAPI } from '../services/api';
import toast from 'react-hot-toast';
import { Users, Plus, Search } from 'lucide-react';

const CustomersList = () => {
  const [customers, setCustomers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [searchTerm, setSearchTerm] = useState('');

  useEffect(() => {
    loadCustomers();
  }, []);

  const loadCustomers = async () => {
    try {
      setLoading(true);
      const response = await customersAPI.getAll({ search: searchTerm });
      setCustomers(response.data.data);
    } catch (error) {
      console.error('Errore caricamento clienti:', error);
      toast.error('Errore nel caricamento dei clienti');
    } finally {
      setLoading(false);
    }
  };

  const handleSearch = (e) => {
    e.preventDefault();
    loadCustomers();
  };

  return (
    <div>
      <div className="top-bar">
        <h1>Gestione Clienti</h1>
        <Link to="/customers/new" className="btn btn-primary">
          <Plus size={18} />
          Nuovo Cliente
        </Link>
      </div>

      <div className="content-area">
        <div className="card">
          <div className="card-header">
            <h2 className="card-title">Ricerca Cliente</h2>
          </div>
          <div className="card-body">
            <form onSubmit={handleSearch} style={{ display: 'flex', gap: '12px' }}>
              <input
                type="text"
                className="form-control"
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                placeholder="Cerca per nome, codice fiscale, telefono..."
                style={{ flex: 1 }}
              />
              <button type="submit" className="btn btn-primary">
                <Search size={18} />
                Cerca
              </button>
            </form>
          </div>
        </div>

        <div className="card">
          <div className="card-header">
            <h2 className="card-title">Clienti ({customers.length})</h2>
          </div>
          <div className="card-body" style={{ padding: 0 }}>
            {loading ? (
              <div className="spinner"></div>
            ) : customers.length === 0 ? (
              <div style={{ padding: '40px', textAlign: 'center', color: '#6c757d' }}>
                <Users size={48} style={{ opacity: 0.3, marginBottom: '16px' }} />
                <p>Nessun cliente trovato</p>
              </div>
            ) : (
              <div className="table-container">
                <table className="table">
                  <thead>
                    <tr>
                      <th>Nome</th>
                      <th>Codice Fiscale</th>
                      <th>Telefono</th>
                      <th>Email</th>
                      <th>Città</th>
                      <th>Azioni</th>
                    </tr>
                  </thead>
                  <tbody>
                    {customers.map((customer) => (
                      <tr key={customer.id}>
                        <td style={{ fontWeight: '600' }}>{customer.full_name}</td>
                        <td><code>{customer.fiscal_code}</code></td>
                        <td>{customer.phone}</td>
                        <td>{customer.email}</td>
                        <td>{customer.city}</td>
                        <td>
                          <Link
                            to={`/customers/${customer.id}`}
                            className="btn btn-sm btn-outline-primary"
                          >
                            Dettagli
                          </Link>
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default CustomersList;
